import React from "react";
import Navbar from "./Navbar";

function Blog() {
  return (
    <div className="max-w-[1400px] h-auto mx-auto">
      <Navbar />
      <div className="h-[100vh]">
        <h1 className="text-white text-2xl">Keto diet for sugar patients</h1>
        <div className="flex flex-col gap-4">
          <input
            type="text"
            className="w-[500px] h-[30px] "
            placeholder="Enter Title"
          />
          <input
            type="text"
            className="w-[500px] h-[30px] "
            placeholder="Enter Title"
          />
        </div>
      </div>
    </div>
  );
}

export default Blog;
